input = ''


checker = []

for i in range(0,len(input)):
    checker.append(input[i])
    

    if len(checker) == 4 and len(checker) == len(set(checker)):
        
        print("The marker appears after the {0}th character".format(i+1)) #part 1 answer
        break
    
    elif len(checker) == 4:
       
        checker.pop(0)

